import React from 'react';

function Outdoors() {
    return (
            <g className="outdoors">
                <rect id="sky" width="300" height="400" fill="#b3e6ff" />
                <rect id="grass" x="0" y="300" width="300" height="100" fill="#8ccd7e" />
            </g>
    );
}

export default Outdoors;
